import React, {Component} from 'react';

class Calculator extends Component {
  constructor() {
    super();
    this.state = {
      x: '',
      total: '',
    };
  }

  handleButtonClick = () => {};

  render() {
    return (
      <div>
        <div>Screen</div>
        <ul style={rows}>
          <li>7</li>
          <li>8</li>
          <li>9</li>
          <li>/</li>
        </ul>
        <ul>
          <li>4</li>
          <li>5</li>
          <li>6</li>
          <li>X</li>
        </ul>
        <ul>
          <li>1</li>
          <li>2</li>
          <li>3</li>
          <li>-</li>
        </ul>
        <ul>
          <li>0</li>
          <li>.</li>
          <li>+</li>
          <li>=</li>
        </ul>
      </div>
    );
  }
}

const rows = {
  display: 'flex',
};

export default Calculator;
